import React from 'react';
import PropTypes from 'prop-types';

class Algorithm extends React.Component {
    render() {
        return (
            <div>
                <p> {this.props.algorithm.name} </p>
            </div>
        );
    }
}

Algorithm.propTypes = {
    algorithm: PropTypes.object.isRequired
}

export default Algorithm;
